import React from 'react';
import { Dropdown } from 'react-bootstrap';


export const Regions = ({ regions, onClick }) => {
    return (
        <Dropdown>
            <Dropdown.Toggle variant="success" id="region-dropdown">
                Regions
                </Dropdown.Toggle>
            <Dropdown.Menu>
                {regions.map(reg =>
                    <Dropdown.Item onClick={() => onClick(reg)}>
                        {reg}
                    </Dropdown.Item>
                )}
            </Dropdown.Menu>
        </Dropdown>
    )
}
